import React, { useState, useEffect } from 'react'

function View2() {
    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch("/view2").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
            }
        )
    }, [])

    console.log(data.list)

    return (
        <div>
            <h1>This is the View 2 page</h1>
            <p>{data.list[0]}</p>
        </div>
    )
}

export default View2;
